import { NavLink } from "reactstrap";
import "./FiltroPesquisa.css"


const FiltroPesquisa = (props) => {
    return (
        <div className="aba-busca">
            <ul className="aba-pequisa">
                <li><a href="#1">Buscar por produto</a></li>
                <li><a href="#2">Palavra-chave</a></li>
                <li><a href="#3">Marca/modelo do ve√≠culo </a></li>
                <NavLink
                    to="users"
                    className={({ isActive }) =>
                        isActive ? 'bg-green-500 font-bold' : 'bg-red-500 font-thin'
                    }
                >
                    Users
                </NavLink>
            </ul>
        </div>);
}

export default FiltroPesquisa;
